INSERT INTO books VALUES(15,'Only Say Good Things','Crystal Hefner',205,3,0,NULL,'Expected but eye opening book.','2024-07-02 13:32:15');
INSERT INTO books VALUES(16,'Omnivore''s Dilemma','Michael Pollan',463,4,0,NULL,'Good book - section on foraging/hunting was a little dry.','2024-07-02 13:33:38');
INSERT INTO books VALUES(17,'Fire Weather: A True Story from a Hotter World','John Vaillant',432,5,0,NULL,'Great book about Fort McMurray and climate science and its affects.','2024-08-26 17:55:07');
INSERT INTO books VALUES(18,'In Defense of Food','Michael Pollan',205,5,0,NULL,'Great quick read about the dangers of nutritionism and eating whole foods.','2024-09-13 15:19:26');
INSERT INTO books VALUES(19,'Math with Bad Drawings','Ben Orlin',376,5,0,NULL,'Smart, funny, and insightful book about the nuances of life and relation to math.','2024-09-13 15:28:29');
INSERT INTO books VALUES(20,'Beautyland','Marie-Helene Burtino',336,3,0,NULL,'Very distinctive writing style.  Good book about reflections of human life and intracacies.  ','2024-10-25 20:36:31');
INSERT INTO books VALUES(21,'Eruption','Michael Crichton',432,4,1,NULL,'Entertaining book that had good pace.','2024-12-01 15:46:34');
INSERT INTO books VALUES(22,'Phantom Orbit','David Ignatius',384,4,1,NULL,'Fascinating interplay between real events and fictional story. ','2024-12-18 01:29:18');
INSERT INTO books VALUES(23,'Rental House','Weike Wang',224,4,1,'2024-12-03','I gave it 4 stars - I wouldn’t read it again.  I like the writing style as it was very entertaining but I didn’t get the point.  It just seemed like a tragic comedy of a millennial biracial couple. ','2024-12-23 22:02:28');
INSERT INTO books VALUES(24,'You Are Not So Smart','David McRaney',302,3,0,NULL,'Decently good psychology book that goes over many of the biases you experience on a daily basis and other fallacies.','2025-01-18 21:25:39');
INSERT INTO books VALUES(25,'You Like It Darker','Stephen King',502,5,1,'2024-05-21','A collection of short stories.  Overall pretty engaging and interesting stories.  Nothing groundbreaking but it was a page turner and i would definitely read again for entertainment. ','2025-03-11 14:47:11');
INSERT INTO books VALUES(26,'A Talent for Murder','Peter Swanson',255,5,1,'2024-06-10','I thought it was just a good entertaining read! keeps your attention and has good pace!','2025-04-04 14:00:35');
INSERT INTO books VALUES(27,'The Anxious Generation','Jonathan Haidt',400,5,0,'2025-03-26','I''m not normally a fan of pyschology books but this one was really good.  No need to read again but it was very insightful about the dangers of phones and social media to young kids. ','2025-06-02 19:39:23');
INSERT INTO books VALUES(28,'The God of the Woods','Liz Moore',490,5,1,'2024-07-02','Really entertaining and captivating book with lots of twists and turns.','2025-07-06 14:25:53');
INSERT INTO books VALUES(29,'Die With Zero','Bill Perkins',240,3,0,'2020-07-28','A good concept but from the perspective of someone who doesn''t need to save another penny for his life. So of course he wants to invest in experiences.  I''m not sure who the targes audience is: I would imagine not too many 20 somethings would read this book but the messages of risk taking and investing in life experiences are directed towards that cohort.  But it is never too late to start. ','2025-07-21 13:19:50');
