PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS cars (id INTEGER PRIMARY KEY ASC AUTOINCREMENT UNIQUE NOT NULL, displayName TEXT UNIQUE NOT NULL, searchUrl TEXT UNIQUE, isOwned BOOLEAN NOT NULL, created DATETIME DEFAULT (CURRENT_TIMESTAMP) NOT NULL);
CREATE TABLE IF NOT EXISTS consumption (id INTEGER PRIMARY KEY ASC AUTOINCREMENT, carId INTEGER NOT NULL REFERENCES cars (id), price REAL NOT NULL, gallons REAL NOT NULL, miles REAL NOT NULL, notes TEXT DEFAULT NULL, created DATETIME NOT NULL DEFAULT (CURRENT_TIMESTAMP));
CREATE TABLE IF NOT EXISTS genres (id INTEGER PRIMARY KEY ASC AUTOINCREMENT, description TEXT UNIQUE NOT NULL, created DATETIME NOT NULL DEFAULT (CURRENT_TIMESTAMP));
CREATE TABLE IF NOT EXISTS books (id INTEGER PRIMARY KEY ASC AUTOINCREMENT, title TEXT NOT NULL, author TEXT NOT NULL, pages INTEGER NOT NULL, rating INTEGER NOT NULL, isFiction BOOLEAN NOT NULL, publishDate DATETIME, review TEXT, created DATETIME DEFAULT (CURRENT_TIMESTAMP) NOT NULL);
CREATE TABLE IF NOT EXISTS books_genres_association (id INTEGER PRIMARY KEY ASC AUTOINCREMENT, bookId INTEGER NOT NULL REFERENCES books (id) ON DELETE RESTRICT, genreId INTEGER NOT NULL REFERENCES genres (id) ON DELETE RESTRICT, created DATETIME NOT NULL DEFAULT (CURRENT_TIMESTAMP), UNIQUE (bookId ASC, genreId ASC));
CREATE TABLE IF NOT EXISTS swim_tags (
id      INTEGER PRIMARY KEY
NOT NULL,
created INTEGER DEFAULT (CURRENT_TIMESTAMP)
NOT NULL,
tag     TEXT    UNIQUE
NOT NULL
);
CREATE TABLE IF NOT EXISTS swim_workouts (
id              INTEGER  NOT NULL
PRIMARY KEY AUTOINCREMENT,
created         DATETIME NOT NULL
DEFAULT CURRENT_TIMESTAMP,
swimWorkoutText TEXT     NOT NULL,
yards           INT      NOT NULL,
isVisible       INTEGER  NOT NULL
DEFAULT '1', author TEXT,
UNIQUE (
id
)
);
CREATE TABLE IF NOT EXISTS swim_workout_tag_association (
id            INTEGER PRIMARY KEY
NOT NULL,
created       TEXT    DEFAULT (CURRENT_TIMESTAMP)
NOT NULL,
swimWorkoutId INTEGER REFERENCES swim_workouts (id)
NOT NULL,
swimTagId     INTEGER REFERENCES swim_tags (id)
NOT NULL,
UNIQUE (
swimWorkoutId,
swimTagId
)
);
DELETE FROM sqlite_sequence;
COMMIT;
